import TableCustum from "../../../components/elements/table/Table";
import columnsKategori from "../../../columns/kategori";
import CardCustum from "../../../components/elements/card/Card";
import dynamic from "next/dynamic";
const ClientComponent = dynamic(() => import("../../../components/elements/table/Table"), {
  // Do not import in server side
  ssr: false,
})
const kategori = () => {
  return (
    <div>
      <CardCustum title=" الأقسام">
        <TableCustum url="/admin/getEvent" columns={columnsKategori}/>
      </CardCustum>
    </div>
  )
}

export default kategori;
